import React, { useEffect, useState} from 'react';
import {Link} from 'react-router-dom';
import Navbar from './Navbar';
import useHttpGet from '../hooks/httpGet';
import Stocks from './Stocks';

function Dashboard(props) {
  const [stocks, setStocks] = useHttpGet(`http://localhost:5000/api/userStocks/${props.username}`, [], "Got user's stocks");
  
  const handleLogout = () => {
    console.log("ran handle logout");
    sessionStorage.removeItem("username");
  }

  return(
    <div>
      <Navbar user = {props.username} handleLogout = {handleLogout}/>
      <Stocks userStock = {stocks}/>
    </div>

  );
}

export default Dashboard;
